import Description from "../components/Description";
import MarcoLegal from "../components/MarcoLegal";
import Structure from "../components/Structure";
import Atributions from "../components/Atributions";
import Incidencia from "../components/Incidencia";
import PlanEstrategico from "../components/PlanEstrategico";
import TemasPrioritarios from "../components/TemasPrioritarios";

const Index = () => {
  return (
    <>
      <Description />
      <MarcoLegal />
      <Structure />
      <Atributions />
      <Incidencia />
      <PlanEstrategico />
      <TemasPrioritarios />
    </>
  );
};

export default Index;
